import React, { Component } from 'react'
import link from '../components/About'

export default class Header extends Component {
  render() {
    return (
      <header>
        <div>
          <h3>Caroline Nunes</h3>
        </div>

        <div>
            <Link>{link}</Link>
        </div>
      </header>
    )
  }
}
